SELECT DISTINCT UF.NOME_COMP, A.ALUNO, A.NOME_COMPL AS NOME_ALUNO,P.CPF, P.ENDERECO, P.END_NUM AS NUMERO, P.END_COMPL, P.CEP, P.BAIRRO, M.NOME, M.UF, ISNULL(VW.valor/6,0) AS VALOR, '10/08/2017' AS VENCIMENTO, CAI.CODIGO_HASH, CA.DATA_ACEITE 
--INTO #TEMP2
  FROM LY_UNIDADE_FISICA UF
JOIN LY_ALUNO A ON A.UNIDADE_FISICA = UF.UNIDADE_FIS
JOIN LY_PESSOA P ON P.PESSOA = A.PESSOA
JOIN VW_FTC_ALUNO_CURSO_VALOR_FAT VW ON VW.aluno = A.ALUNO
JOIN LY_CONTRATO_ALUNO CA ON CA.ALUNO = A.ALUNO AND CA.ANO = VW.ano AND CA.PERIODO = VW.periodo
JOIN LY_CONTRATO_ALUNO_IMG CAI ON CAI.ID_CONTRATO_ALUNO = CA.ID_CONTRATO_ALUNO
JOIN HD_MUNICIPIO M ON M.MUNICIPIO = P.END_MUNICIPIO
JOIN LY_CURSO C ON C.CURSO = A.CURSO
JOIN VW_COBRANCA VW2 ON VW2.ALUNO = VW.aluno
WHERE CA.CONTRATO_ACEITO = 'S'
AND VW.ano = '2017' AND CA.PERIODO = '1'
AND C.TIPO IN ('GRADUACAO','TECNOLOGO')
AND EXISTS (SELECT 1 FROM LY_ITEM_CRED IC WHERE IC.COBRANCA = VW2.COBRANCA AND IC.ITEM_ESTORNADO IS NULL)
AND A.ALUNO NOT IN (SELECT ALUNO FROM #TEMP)
ORDER BY 1,3